import React from 'react';
import {
    View,
    StyleSheet,
    FlatList
} from 'react-native';

import Icon from '../components/Icon';
import Screen from '../components/Screen';
import ListItem from '../components/ListItem';
import colors from '../config/colors';
import ListItemSeparator from '../components/ListItemSeparator';

const menuItems = [{
        title: "My Listings",
        icon: {
            name: "format-list-bulleted",
            backgroundColor: colors.primary
        }
    },
    {
        title: "My Messages",
        icon: {
            name: "email",
            backgroundColor: colors.secondary
        }
    }
]

function AccountScreen(props) {
    return ( <
        Screen sytle = {
            styles.screen
        } >
        <
        View style = {
            styles.screen
        } >
        <
        ListItem title = "Roshan Sapkota"
        subTitle = "Sapkotaroshan@gmail.com"
        image = {
            require("../assets/mosh.jpg")
        }
        /> < /
        View > <
        View style = {
            styles.container
        } >
        <
        FlatList data = {
            menuItems
        }
        keyExtractor = {
            menuItem => menuItem.title
        }
        ItemSeparatorComponent = {
            ListItemSeparator
        }
        renderItem = {
            ({
                item
            }) => ( <
                ListItem title = {
                    item.title
                }
                IconComponent = {
                    <
                    Icon
                    name = {
                        item.icon.name
                    }
                    backgroundColor = {
                        item.icon.backgroundColor
                    }
                    />
                }
                />
            )
        }
        /> < /
        View > <
        ListItem title = "Logout"
        IconComponent = {
            <
            Icon name = "logout"
            backgroundColor = "#ffe66d" / >
        }
        /> < /
        Screen >
    );
}

const styles = StyleSheet.create({
    container: {
        marginVertical: 20
    },
    screen: {
        backgroundColor: colors.secondary,
    }
})

export default AccountScreen;
